(10, 0, 0, '0%', 55, '0%', 10, 3000, '0%', 'Galvanize: \nMoving and Stealth increase Energized by 75% faster.\n Firmament: \nYour energized attack deals additional physical damage and slows for 0.75 seconds.', '0%', 0, '0%', 'https://static.bigbrain.gg/assets/lol/riot_static/14.22.1/img/item/6699.png', 18, '0%', '0%', 0, 0, '0%', '0%', 'Voltaic Cyclosword', '0%', 4, NULL),
